import styled from 'styled-components';
const CardDiv = styled.div
`
    display: flex;
    flex-direction: column;
    align-items: center;
    text-align: center;
    height: 250px;
    width: 175px;
    background: white;
    margin: 15px;
    border-radius: 20px;
    box-shadow: 0px 0px 10px black;
    padding: 15px;
    transition: all 0.2s ease-in-out;
    overflow-x:hidden;

    &:hover {
        background: #AFB0B4;
    }
`;

const Img = styled.img
`
    height: 200px;
`

const Card = ({src}) => {
    return (
        <CardDiv>
            TITS Title
            <Img src={src}></Img>
        </CardDiv>

    )
}

export default Card;
